import React from 'react';

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/songs">Songs</a></li>
        <li><a href="/artists">Artists</a></li>
        <li><a href="/albums">Albums</a></li>
      </ul>
    </nav>
  );
};

export default Navigation;
